import useLoginLogoutContext from "../context/toggleLoginLogout";

const {textQuery} = useLoginLogoutContext();

const Routes = {
    home: "/",
    nam: "/nam",
    nu: "/nu",
    treem: "/treem", 
    login: "/login",
    test: "/test",
    searchProduct: `/search?query=${textQuery}`
}
export default Routes;
